import React, { Component } from "react";
import Img1 from "../assets/img.jpg";
import Img2 from "../assets/img2.jpg";
import Img3 from "../assets/img3.jpg";
import Img4 from "../assets/img4.jpg";
import Img5 from "../assets/img5.jpg";
import Img6 from "../assets/img6.jpg";
import { faFileCode ,  faFileUpload, faUser , faCog , faCalendar ,  faEnvelope  } from '@fortawesome/free-solid-svg-icons';


export default class Model extends Component {
   render() {
      let modelStyle = {
         display: "block",
         backgroundColor: "rgba(0,0,0,0.8)",
      };

      return (
         <div class="modal show fade " style={modelStyle} >
            <div className="modal-dialog">
               <div className="modal-content">
                  <div className="modal-header">
                     <h5 className="modal-title">{this.props.title}</h5>
                     <button
                        type="button"
                        className="btn-close"
                        onClick={this.props.hide}
                     ></button>
                  </div>
                  <div className="modal-body">
                     <img src={this.props.img} className="img-fluid" alt="" />
                     {/* <p>{this.props.desc}</p> */}
                     <ul>
                        <li>{this.props.desc1}</li>
                        <li>{this.props.desc2}</li>
                        <li>{this.props.desc3}</li>
                     </ul>
                    
                  </div>
               </div>
            </div>
         </div>
      );
   }
}
